import React from 'react'

export default function ListItem({item}) {
    return (
        <div>
            {
                item.details !== "" ? (
                    <>
                        <p style={{fontWeight: "bold"}}>{item.timestamp + " " + item.user + ":"}</p>
                        <p>Hi</p>
                    </>

                ) : (
                    <p>{item.user}</p>
                )
            }
        </div>
    )
}
